(defn hsv-mat [h s v] 
  (let[m (new-mat 17 3 CV_8UC3)]
    (cvt-color! m COLOR_BGR2HSV)
    (set-to m (new-scalar h s v))
    (cvt-color! m COLOR_HSV2BGR)
    m))

(->> (range 180)
     (map #(hsv-mat % 255 255))
     (hconcat!)
	 (u/mat-view))

(->> (range 180)
     (map #(hsv-mat % 100 255))
     (hconcat!)
	 (u/mat-view))

(->> (range 180)
     (map #(hsv-mat % 255 100))
     (hconcat!)
	 (u/mat-view))

